    public static void convertFromMapToJSON() {

        Map<String, Object> dataMap = new HashMap<>();
        Map<String, String> dataMap1 = new HashMap<>();
        dataMap.put("startDate", "2022-08-01");
        dataMap.put("endDate", "2022-11-05");

        dataMap1.put("id", "0e1af19a-f60c-4d0d-b8dd-10bce03e6b3e");
        dataMap1.put("name", "ONLINE");
        dataMap1.put("storeCount", "0");


        dataMap.put("value", dataMap1);
        String ss = "{\"startDate\":\"2022-08-01\",\"endDate\":\"2022-11-05\",\"value\":{\"id\":\"0e1af19a-f60c-4d0d-b8dd-10bce03e6b3e\",\"name\":\"ONLINE\",\"storeCount\":\"0\"}}";

        String id = "\"0e1af19a-f60c-4d0d-b8dd-10bce03e6b3e\"";
        String response = "{\"startDate\":\"2022-08-01\",\"endDate\":\"2022-11-05\",\"value\":{\"id\":" + id + ",\"name\":\"ONLINE\",\"storeCount\":\"0\"}}";


        System.out.println("Response is ->" + response);
        // Create a StringBuilder to construct the JSON string
        StringBuilder jsonBuilder = new StringBuilder("{");

// Iterate over the Map entries and add them to the JSON string
        for (Map.Entry entry : dataMap.entrySet()) {

            // Add the key
            jsonBuilder.append("\"").append(entry.getKey()).append("\":");

            // Add the value
            Object value = entry.getValue();
            if (value instanceof String) {
                jsonBuilder.append("\"").append(value).append("\"");
            } else {
                jsonBuilder.append(value);
            }

            // Add a comma to separate entries
            jsonBuilder.append(",");
        }

// Remove the trailing comma and close the JSON object
        if (jsonBuilder.charAt(jsonBuilder.length() - 1) == ',') {
            jsonBuilder.deleteCharAt(jsonBuilder.length() - 1);
        }
        jsonBuilder.append("}");

        // Get the final JSON string
        String jsonString = jsonBuilder.toString();

        System.out.println(jsonString);


    }


